CommandButton.CSS:
.sb-commandbar-icon {
  color: "[theme: white]";
}

.sb-commandbar-button {
  color: "[theme: white]";
  border-width: 4px;
  border-style: solid;
  background-color: "[theme: themeDarker]";
  border-color: "[theme: white]";
  border-radius: 8px;
}

.sb-commandbar-button:active {
  color: "[theme: primaryButtonTextPressed]";
  border-color: "[theme: white]";
  background-color: "[theme: primaryButtonBackgroundPressed]";
}

.sb-commandbar-button:hover:not(:active) {
  color: "[theme: primaryButtonText]";
  border-color: "[theme: white]";
  background-color: "[theme: primaryButtonBackgroundHovered]";
}

.sb-commandbar-button.is-disabled {
  border-color: "[theme: white]";
}
